import React from 'react';
import './button.css';

function Button(props) {
  const { size } = props;

  let buttonClass;
  if (size === 'high') {
      buttonClass = 'high';
  } else if (size === 'medium') {
      buttonClass = 'medium';
  } else {
      buttonClass = 'low';
  }
  return (
    <button type="button" className={buttonClass} size = {size}>Hi!</button>
  );
}

export default Button;
